import styled from 'styled-components';


export const Area = styled.div`
  height: 400px;
  background: red;
  align-item: center;
  vertical-align: center;
  display: flex;
`;

export const Card = styled.div`
  height: 300px;
  background: white;
  border: 1px solid #C3C1B1;
  width: 200px;
  margin: 40px;
  display: inline-block;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
align-items: center;

`;
